def is_remote_control_lost(remote:item):
    # Function to check if the remote control is found
    return not visited(remote)

behavior find_remote_control(remote:item):
    body:
        observe(remote, "Check if this is the remote control")

behavior __goal__():
    body:
        if exists remote: item : is_remote_control(remote) and visited(remote):
            bind remote: item where:
                is_remote_control(remote) and visited(remote)
            assert not is_remote_control_lost(remote)
        else:
            foreach remote: item:
                if is_remote_control(remote) and is_remote_control_lost(remote):
                    find_remote_control(remote)
